ovom Sadu, koja je zatim bila u vlasništvu istaknutog novosađanina Arse Pajevića, sve do 1895. godine. Te godine štampariju je od svog kuma, pomenutog Arse Pajevića, kupio Đorđe Ivković (1858-1920), osnivač i začetnik današnjeg Ateljea i knjigoveznice Ivković.'),(2674,175,'_flexible_4_text','field_60b34b0c7bf71'),(2675,175,'flexible_4_link','a:3:{s:5:\"title\";s:12:\"Saznaj više\";s:3:\"url\";s:1:\"#\";s:6:\"target\";s:0:\"\";}'),(2676,175,'_flexible_4_link','field_60b34a967bf6d'),(2677,175,'flexible_4_background','143'),(2678,175,'_flexible_4_background','field_60b34af57bf70'),(2679,175,'flexible_4_image','145'),(2680,175,'_flexible_4_image','field_60b34a967bf69'),(2681,175,'flexible_4_active','1'),(2682,175,'_flexible_4_active','field_60b34a967bf6f'),(2683,175,'flexible_5_text','<!--(figmeta)eyJmaWxlS2V5IjoiWVljczg0VnBDdHdCUUNJUUc2UXNpTyIsInBhc3RlSUQiOjIwODQzNzgzMTYsImRhdGFUeXBlIjoic2NlbmUifQo=(/figmeta)--><!--(figma)(/figma)--><strong>Registracijom</strong> je kupovina udobnija, pretraga lakša, a popusti zagarantovani.'),(2684,175,'_flexible_5_text','field_60b34e4f3e97f'),(2685,175,'flexible_5_background','155'),(2686,175,'_flexible_5_background','field_60b34e4f3e981'),(2687,175,'flexible_5_link','a:3:{s:5:\"title\";s:12:\"Registruj se\";s:3:\"url\";s:38:\"http://localhost/ivkovic/registracija/\";s:6:\"target\";s:0:\"\";}'),(2688,175,'_flexible_5_link','field_60b34e4f3e980'),(2689,175,'flexible_5_active','1'),(2690,175,'_flexible_5_active','field_60b34e4f3e984'),(2691,175,'flexible_6_title','Novosti'),(2692,175,'_flexible_6_title','field_60b3510e500be'),(2693,175,'flexible_6_active','1'),(2694,175,'_flexible_6_active','field_60b3510e500c2'),(2803,167,'_thumbnail_id','162'),(2805,159,'liked_IPs','a:1:{i:0;s:3:\"::1\";}'),(2806,177,'_wpml_word_count','{\"total\":0,\"to_translate\":{\"en\":2,\"sr\":2}}'),(2807,177,'_edit_last','3'),(2808,177,'_wp_page_template','default'),(2809,177,'_wpml_media_duplicate','1'),(2810,177,'_wpml_media_featured','1'),(2811,177,'_edit_l