. godine kada je Emanuil Janković osnovao prvu štampariju u Novom Sadu, koja je zatim bila u vlasništvu istaknutog novosađanina Arse Pajevića, sve do 1895. godine. Te godine štampariju je od svog kuma, pomenutog Arse Pajevića, kupio Đorđe Ivković (1858-1920), osnivač i začetnik današnjeg Ateljea i knjigoveznice Ivković.'),(3247,207,'_flexible_4_text','field_60b34b0c7bf71'),(3248,207,'flexible_4_link','a:3:{s:5:\"title\";s:12:\"Saznaj više\";s:3:\"url\";s:1:\"#\";s:6:\"target\";s:0:\"\";}'),(3249,207,'_flexible_4_link','field_60b34a967bf6d'),(3250,207,'flexible_4_background','143'),(3251,207,'_flexible_4_background','field_60b34af57bf70'),(3252,207,'flexible_4_image','145'),(3253,207,'_flexible_4_image','field_60b34a967bf69'),(3254,207,'flexible_4_active','1'),(3255,207,'_flexible_4_active','field_60b34a967bf6f'),(3256,207,'flexible_5_text','<!--(figmeta)eyJmaWxlS2V5IjoiWVljczg0VnBDdHdCUUNJUUc2UXNpTyIsInBhc3RlSUQiOjIwODQzNzgzMTYsImRhdGFUeXBlIjoic2NlbmUifQo=(/figmeta)--><!--(figma)(/figma)--><strong>Registracijom</strong> je kupovina udobnija, pretraga lakša, a popusti zagarantovani.'),(3257,207,'_flexible_5_text','field_60b34e4f3e97f'),(3258,207,'flexible_5_background','155'),(3259,207,'_flexible_5_background','field_60b34e4f3e981'),(3260,207,'flexible_5_link','a:3:{s:5:\"title\";s:12:\"Registruj se\";s:3:\"url\";s:38:\"http://localhost/ivkovic/registracija/\";s:6:\"target\";s:0:\"\";}'),(3261,207,'_flexible_5_link','field_60b34e4f3e980'),(3262,207,'flexible_5_active','1'),(3263,207,'_flexible_5_active','field_60b34e4f3e984'),(3264,207,'flexible_6_title','Novosti'),(3265,207,'_flexible_6_title','field_60b3510e500be'),(3266,207,'flexible_6_active','1'),(3267,207,'_flexible_6_active','field_60b3510e500c2'),(3268,207,'flexible_7_slides_0_title','Katalog iz 2020/21.'),(3269,207,'_flexible_7_slides_0_title','field_60b36c97ba372'),(3270,207,'flexible_7_slides_0_text','Odabrani artikli iz naše palete proizvoda'),(3271,207,'_flexible_7_slides_0_text','field_60b36c97ba374'),(